import React from 'react'
import _Badge from './reactstrap/_Badge'
import './App.css'
import 'bootstrap/dist/css/bootstrap.css'   // bootstrap css 적용

/*
    bootstrap은 프론트엔드 디자인을 쉽게 구현할 수 있도록 도와주는 
    html, css, js 프레임워크다..

    ! 사용 전 패키지 설치 방법 
    npm install -bootstrap  

    자세한 내용은 여기서 확인 
    https://getbootstrap.kr/docs/5.3/getting-started/introduction/

*/
const App = () =>{
    return(
        <div>
            <h1>Start React 200!</h1>
            <p>CSS 적용하기</p>
            <_Badge />
        </div>
    );
}   

export default App;
